class SnakeNode {
  constructor(val) {
    this.val = val;
    this.next = null;
  }
}

export class Snake {
  constructor(x, y) {
    const node = new SnakeNode({ x, y });
    this.head = node;
    this.tail = node;
  }
  moveLeft() {
    console.log(this.head);
    const { x, y } = this.head.val;
    const node = new SnakeNode({x: x + 1, y});
    this.head = node;
  }
}
